import { Link,NavLink } from 'react-router-dom'

import './navBarStyle.css';

import navbarDeco from '../../data/images/navbarDeco_List.jpg'

export const NavBar = () => {

  return (
    <>
    
      <div className = 'myNavBar'>

        <NavLink className = { ({isActive})=> `navLink ${ isActive ? 'myRoutesOn':'myRoutesOff'}`} to='/home'> Mis rutas </NavLink>

        <NavLink className = { ({isActive})=> `navLink ${ isActive ? 'newRouteOn':'newRouteOff'}`} className = 'navLink newRouteOn' to='/newRoute'> Agregar nueva ruta </NavLink>

        <NavLink className = 'navLink completedRouteOn' to='/completed'> Rutas completadas </NavLink>

        <NavLink className = 'navLink trashRoutesOn' to='/trash'> Papelera </NavLink>

      </div>

      <img src = {navbarDeco} alt='imagen de navbar' className='imageNavBar'/>
    
    </>


  )
}
